  input: "\"TEXT\",\"F3XA\",\"C00409003\",\"March 10, 2006    Brandis L Zehr  Campaign
    Finance Analyst  Reports Analysis Division  Federal Election Commission  999 E
    9th Street\t  Washington, DC  20463    Dear Brandis,    This letter is in response
    to your March 3, 2006, letter of inquiry regarding two disbursements that were
    reported on the Year End Report (7/1/05 - 12/31/05) for Heartland Values PAC (C00409003).
    \ We have reviewed our records supporting the above-referenced report and provide
    the following additional information in response to your questions:    Apparent
    Excessive Contributions on Schedule B:  These contributions to federal candidates
    are split between the primary and general election cycles.  I have made the clerical
    corrections and have attached our amended report.    Clarify all expenditures
    made for Equipment Lease on Schedule B:  These expenditures were made for office
    equipment leasing for use by Heartland Values PAC and were not on behalf of any
    specific candidate.  Therefore, there is no need to amend the report to clarify
    expenditures made for Equipment Lease.    Clarify all expenditures made for Event
    Catering, Event Expense, Fundraising, Fund Raising and Fund Raising Expense on
    Schedule B:  These expenditures for the purpose of fundraising in our 2005 Year
    End Report.  They were all expenditures for fundraising consulting for Heartland
    Values PAC and not on behalf of any specific candidate.  Therefore, there is no
    need to amend the report to clarify expenditures made for Event Catering, Event
    Expense, Fundraising, Fund Raising and Fund Raising Expense.    Schedule B discloses
    expenditures for Mailing, Mailing Service, Mailing Services, Postage, Printing
    and Stamps:  These expenditures did not contain express advocacy and were not
    for the election or defeat of any specific candidate.  Rather, these expenditures
    were for mailings to raise funds for Heartland Values PAC.  Therefore, there is
    no need to amend the report to clarify expenditures made for Mailing, Mailing
    Service, Mailing Services, Postage, Printing and Stamps.    We trust this information
    answers your questions.  If you have any further questions or need additional
    information, please do not hesitate to contact me at 605/376-3437.    Sincerely,
    \   Barb Buell  Deputy Treasurer  Heartland Values PAC  PO Box 505  Sioux Falls,
    SD  57101-0505\""
